import React from 'react'
import MovieCard from './MovieCard'
import MovieFiletr from './MovieFilter'


function MovieListe({films}) {
    return (
        <div className='container'>
         <MovieFiletr/>
            {films.map(el=><MovieCard film={el}/>)}
        </div>
    )
}

export default MovieListe
